import { userDataAction } from '../reducers/userStore';
let errorList = [];
export const setUserAction = (data) => {
  return async (dispatch) => {
    try {
      if (Object.keys(data).length) {
        if (data.email === '') {
          errorList.push({ errorType: 'errorText', message: 'errorText' })
        } else {
          errorList = []
        }
        dispatch(
          userDataAction.setLoginError(errorList)
        );
      }
    } catch (error) {
      console.error('hi-808: ', error);
      return error;
    }
  };
};
